import React from 'react';
import { Link } from 'react-router-dom';

import './App.css';

export default function HomePage() {
  return (
    <div className="home">
        <div className="button-container">
        <span className="button-text">Go to Other Page</span>
        <Link to="/other-page">
          <button className="top-button">Click Me</button>
        </Link>
      </div>
    </div>
  );
}
